import "./App.css";
// importing components from react-router-dom package
import {
BrowserRouter as Router,
Route,
Routes,
} from "react-router-dom";

// import Home component
import Transactions from "./Transactions";

function App() {
return (
	<>
	<Router>

		<Route exact path="/" component={Transactions} />

	</Router>
	</>
);
}

export default App;
